import questions from "./data";

export default function App() {
  return (
    <div>
      <FlashCards />
    </div>
  );
}

function FlashCards() {
  return (
    <div className="flashcards">
      {questions.map((each) => (
        <div className="selected">{each.question}</div>
      ))}
    </div>
  );
}
